import { createUseStyles } from 'react-jss'

const useStyles = createUseStyles({
  name: {
    position: "absolute",
    top: 0,
    left: 0,
    color: "lightgrey",
    textDecoration: "none!important",
    padding: 20
  },
  empty: {},
  root: {
    position: "absolute",
    top: 0,
    right: 0,
    paddingRight: 30,
    height: "10vh",
    width: "50%",
  },
  tab: {
    // textDecoration: 'none'

  },
  scroller: {
    height: "5vh",
  },
  label: {
    fontSize: 18,
    color: "lightgrey",
  },
  background: {
    height: "10vh"
  },
  flex: {
    height: "100%",
    width: "100%",
    right: 0,
    overflowX: "visible !important"
  },


});

export default useStyles;
